import React, { useState, useEffect } from "react";

const Booking = () => {
    const [bookings, setBookings] = useState([]);
    const [formData, setFormData] = useState({
        date: "",
        time: "",
        party_size: 1,
    });
    const [message, setMessage] = useState("");

    useEffect(() => {
        const fetchBookings = async () => {
            try {
                const token = localStorage.getItem("token");
                if (!token) throw new Error("You must be logged in.");

                const response = await fetch("/api/bookings", {
                    headers: { Authorization: `Bearer ${token}` },
                });

                if (!response.ok) throw new Error("Failed to fetch bookings.");

                const data = await response.json();
                setBookings(data);
            } catch (error) {
                setMessage(error.message);
            }
        };

        fetchBookings();
    }, []);

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const token = localStorage.getItem("token");
            if (!token) throw new Error("You must be logged in.");

            const response = await fetch("/api/bookings", {
                method: "POST",
                headers: {
                    "Content-Type": "application/json",
                    Authorization: `Bearer ${token}`,
                },
                body: JSON.stringify(formData),
            });

            if (!response.ok) {
                const errorData = await response.json(); // Get error message from server
                throw new Error(errorData.error || "Failed to create booking.");
            }

            // Refetch bookings after successful creation
            fetch('/api/bookings', {
                headers: { Authorization: `Bearer ${token}` },
            })
            .then(res => {
                if (!res.ok) {
                    throw new Error('Failed to update booking list.');
                }
                return res.json();
            })
            .then(updatedBookings => {
                setBookings(updatedBookings);
                setMessage('Booking created successfully!');
            })
            .catch(error => {
                setMessage(error.message);
            });
        } catch (error) {
            setMessage(error.message);
        }
    };

    const handleUpdate = async (id) => {
        try {
            const token = localStorage.getItem("token");
            if (!token) throw new Error("You must be logged in.");

            // Get updated booking data (you'll need to implement this)
            const updatedBooking = {
                // ... get updated date, time, party_size for the given id
            };

            const response = await fetch(`/api/bookings/${id}`, {
                method: "PUT",
                headers: {
                    "Content-Type": "application/json",
                    Authorization: `Bearer ${token}`,
                },
                body: JSON.stringify(updatedBooking),
            });

            if (!response.ok) {
                const errorData = await response.json();
                throw new Error(errorData.error || "Failed to update booking.");
            }

            // Refetch bookings after successful update
            fetch('/api/bookings', {
                headers: { Authorization: `Bearer ${token}` },
            })
            .then(res => {
                if (!res.ok) {
                    throw new Error('Failed to update booking list.');
                }
                return res.json();
            })
            .then(updatedBookings => {
                setBookings(updatedBookings);
                setMessage('Booking updated successfully!');
            })
            .catch(error => {
                setMessage(error.message);
            });
        } catch (error) {
            setMessage(error.message);
        }
    };

    const handleDelete = async (id) => {
        try {
            const token = localStorage.getItem("token");
            if (!token) throw new Error("You must be logged in.");

            const response = await fetch(`/api/bookings/${id}`, {
                method: "DELETE",
                headers: { Authorization: `Bearer ${token}` },
            });

            if (!response.ok) {
                const errorData = await response.json();
                throw new Error(errorData.error || "Failed to delete booking.");
            }

            setBookings(bookings.filter((booking) => booking.id !== id));
            setMessage("Booking deleted successfully!");
        } catch (error) {
            setMessage(error.message);
        }
    };

    return (
        <div>
            <h1>Booking</h1>
            {message && <p>{message}</p>}
            <form onSubmit={handleSubmit}>
                <div>
                    <label htmlFor="date">Date:</label>
                    <input
                        type="date"
                        id="date"
                        name="date"
                        value={formData.date}
                        onChange={(e) =>
                            setFormData({ ...formData, date: e.target.value })
                        }
                        required
                    />
                </div>
                <div>
                    <label htmlFor="time">Time:</label>
                    <input
                        type="time"
                        id="time"
                        name="time"
                        value={formData.time}
                        onChange={(e) =>
                            setFormData({ ...formData, time: e.target.value })
                        }
                        required
                    />
                </div>
                <div>
                    <label htmlFor="party_size">Party Size:</label>
                    <input
                        type="number"
                        id="party_size"
                        name="party_size"
                        value={formData.party_size}
                        onChange={(e) =>
                            setFormData({
                                ...formData,
                                party_size: parseInt(e.target.value),
                            })
                        }
                        min="1"
                        required
                    />
                </div>
                <button type="submit">Create Booking</button>
            </form>

            <h2>Your Bookings</h2>
            <ul>
                {bookings.map((booking) => (
                    <li key={booking.id}>
                        {booking.date} {booking.time} for {booking.party_size}
                        <button onClick={() => handleUpdate(booking.id)}>
                            Update
                        </button>
                        <button onClick={() => handleDelete(booking.id)}>
                            Delete
                        </button>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default Booking;
